import {deckEnum} from './consts';

export const calcHighestRank = (left: string, right: string) => {
   if (deckEnum.indexOf(left) > deckEnum.indexOf(right)) {
      return deckEnum.indexOf(left);
   } else {
      return deckEnum.indexOf(right);
   }
   console.log(left, right);
   console.log(deckEnum.indexOf(left));
   console.log(deckEnum.indexOf(right));
};
